  \"2016-10-22T11:44:02.662225\",\n\t\"name\": \"alert-iowa-statewide-messaging-system\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Alert Iowa is a statewide mass notification
  and emergency messaging system. The system can be used by state and local authorities
  to quickly disseminate emergency information to residents in counties that utilize
  the system. The system is available, free of charge, to all counties. Only 10 of
  Iowa's 99 counties haven't signed up to use the Alert Iowa system.rn rnAlert Iowa
  will allow citizens to sign up for the types of alerts they would like to receive.
  The best way to receive messages is via text message. Messages may contain photo,
  video and audio attachments to help subscribers better understand the situation
  at hand, or where to find additional information.\",\n\t\"license_title\": \"License
